import "./App.css";
import {} from "@mui/material/styles";
import { Grid, Box, Typography } from "@mui/material";
import { Item } from "./Item.JS";

const mockEvents = [
  { name: "event1" },
  { name: "event2" },
  { name: "event3" },
  { name: "event4" },
  { name: "event5" },
];

function Events() {
  return (
    <Box padding={4}>
      <Box padding={2}>
        <Typography variant="h6">Events this week</Typography>
      </Box>
      <Grid container spacing={2}>
        {mockEvents.map((mockEvent) => (
          <Grid item xs={3}>
            <Item>{mockEvent.name}</Item>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
}

export default Events;
